import React from "react";
import SecondQuiz from "./SecondQuiz";

const StartQuiz = ({ questionAnswer }) => {
  return (
    <div className="w-70% bg-slate-100 flex-col justify-center m-auto mt-8 rounded-md p-6">
      <div className="justify-center flex">
        <h1 className="text-blue-400 uppercase font-serif my-4">Start Quiz</h1>
      </div>
    </div>
  );
};
export default StartQuiz;
